const e=JSON.parse(`{"key":"v-6733e0fc","path":"/cs/database/sql/design/%E5%91%BD%E5%90%8D%E8%A7%84%E8%8C%83.html","title":"命名规范","lang":"en-US","frontmatter":{"description":"命名规范 表命名 最大限度 12，小写 英文单词与下划线组成，命名方式：系统名_表功能名。单词之间用下划线隔开，严禁使用中文拼音。对于单词超长的，可使用单词缩写，但是单词缩写必须能够完整表达原单词的含义。示例：b2c_billrec，该表的含义是 b2c 系统的单据信息表。 临时表命名：tmp_表名缩写_yymmdd 字段命名 最大限度 12，小写 单词+下划线。敏感字段脱敏列应增加_non_sent后缀，命名方式：字段名_non_sent，敏感字段的加密列应增加_encp后缀，索引字段：字段名_idx 需要有含义，能够表达字段的意义，使用名词，而不是动词 禁止使用数据库关键字作为字段名","head":[["meta",{"property":"og:url","content":"https://davidliuk.github.io/blog/blog/cs/database/sql/design/%E5%91%BD%E5%90%8D%E8%A7%84%E8%8C%83.html"}],["meta",{"property":"og:site_name","content":"David's Blog"}],["meta",{"property":"og:title","content":"命名规范"}],["meta",{"property":"og:description","content":"命名规范 表命名 最大限度 12，小写 英文单词与下划线组成，命名方式：系统名_表功能名。单词之间用下划线隔开，严禁使用中文拼音。对于单词超长的，可使用单词缩写，但是单词缩写必须能够完整表达原单词的含义。示例：b2c_billrec，该表的含义是 b2c 系统的单据信息表。 临时表命名：tmp_表名缩写_yymmdd 字段命名 最大限度 12，小写 单词+下划线。敏感字段脱敏列应增加_non_sent后缀，命名方式：字段名_non_sent，敏感字段的加密列应增加_encp后缀，索引字段：字段名_idx 需要有含义，能够表达字段的意义，使用名词，而不是动词 禁止使用数据库关键字作为字段名"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"en-US"}],["meta",{"property":"og:updated_time","content":"2023-09-14T10:15:52.000Z"}],["meta",{"property":"article:author","content":"David Liu"}],["meta",{"property":"article:modified_time","content":"2023-09-14T10:15:52.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"命名规范\\",\\"image\\":[\\"\\"],\\"dateModified\\":\\"2023-09-14T10:15:52.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"David Liu\\",\\"url\\":\\"https://github.com/davidliuk\\"}]}"]]},"headers":[],"git":{"createdTime":1694686552000,"updatedTime":1694686552000,"contributors":[{"name":"liudawei47","email":"liudawei47@jd.com","commits":1}]},"readingTime":{"minutes":1.12,"words":335},"filePathRelative":"cs/database/sql/design/命名规范.md","localizedDate":"September 14, 2023","excerpt":"<h1> 命名规范</h1>\\n<p>表命名</p>\\n<ol>\\n<li>最大限度 12，小写</li>\\n<li>英文单词与下划线组成，命名方式：<code>系统名_表功能名</code>。单词之间用下划线隔开，严禁使用中文拼音。对于单词超长的，可使用单词缩写，但是单词缩写必须能够完整表达原单词的含义。示例：<code>b2c_billrec</code>，该表的含义是 b2c 系统的单据信息表。</li>\\n<li>临时表命名：<code>tmp_表名缩写_yymmdd</code></li>\\n</ol>\\n<p>字段命名</p>\\n<ol>\\n<li>最大限度 12，小写</li>\\n<li>单词+下划线。敏感字段脱敏列应增加<code>_non_sent</code>后缀，命名方式：<code>字段名_non_sent</code>，敏感字段的加密列应增加<code>_encp</code>后缀，索引字段：字段名<code>_idx</code></li>\\n<li>需要有含义，能够表达字段的意义，使用名词，而不是动词</li>\\n<li>禁止使用数据库关键字作为字段名</li>\\n</ol>","autoDesc":true}`);export{e as data};
